// components/Landing.js
import React from 'react';
import './IndustryLanding.css';
import searchIcon from '../assets/searchIcon.png'; // Path to the search icon

function Landing() {
  return (
    <div className="landing-section">
      <nav className="navbar">
        <h1 className="navbar-heading">Navbar</h1>
        <img src={searchIcon} alt="Search" className="search-icon" />
      </nav>
      <div className="landing-content">
        <h1 className="landing-heading">
          <span className="color1">Industry</span>
          <span className="color2"> Market</span>
          <span className="color3"> Trends</span>
        </h1>
      </div>
    </div>
  );
}

export default Landing;
